import React, { Component } from 'react';
import InputRange from 'react-input-range';
import 'react-input-range/lib/css/index.css';


export default class GenerateGrid  extends Component {
    constructor(props) {
      super(props);

      this.state = {
        value: 8
      };
    }
    sendData = (value) => {
        this.props.parentCallback({gridLength :value});
        console.log(value)
   }


    render() {
      return (
        <InputRange
        maxValue={8}
        minValue={0}
        value={this.state.value}
        onChange={value => this.sendData(value)} />
      );
    }
  }
